{#if juradoAberto}
    <div class="modal-overlay" on:click={fecharPopup}>

        <div class="modal-content" on:click|stopPropagation>

            <button class="fechar-btn" on:click={fecharPopup}>X</button>

            {#if juradoAberto === 'jurado_1'}
                <img src="/svg/juris/cards/card_jurado1.svg" alt="Card Jurado 1" class="jurado-card-img" />
            {:else if juradoAberto === 'jurado_2'}
                <img src="/svg/juris/cards/card_jurado2.svg" alt="Card Jurado 2" class="jurado-card-img" />
            {/if}

        </div>
    </div>
{/if}

<style>
    /* Torna o SVG responsivo e centrado */
    svg {
        width: 100%;
        max-width: 1400px;
        height: auto;
        display: block;
        margin: 0 auto;
    }

    /* Faz os botões ficarem opacos quando passas o rato por cima */
    g[role="button"]:hover {
        opacity: 0.8;
    }

    /* Estilos do Popup */
    .modal-overlay {
        position: fixed;
        top: 0;
        left: 0;
        width: 100vw;
        height: 100vh;
        background-color: rgba(0, 0, 0, 0.85); /* Fundo preto transparente */
        display: flex;
        justify-content: center;
        align-items: center;
        z-index: 9999;
    }

    .modal-content {
        position: relative;
        max-width: 90vw;
        max-height: 90vh;
        display: flex;
        justify-content: center;
        align-items: center;
    }

    .jurado-card-img {
        max-width: 100%;
        max-height: 85vh;
        height: auto;
        display: block;
    }

    /* O botão do "X" */
    .fechar-btn {
        position: absolute;
        top: -40px;
        right: 0;
        background: none;
        border: none;
        color: white;
        font-size: 2rem;
        cursor: pointer;
        font-weight: bold;
        padding: 0;
    }

    .fechar-btn:hover {
        color: #FFCD00;
    }

    /* Ajustes para Mobile */
    @media (max-width: 768px) {
        .fechar-btn {
            top: -30px;
            right: 10px;
            font-size: 1.5rem;
        }
    }
</style>